import {useEffect, useState} from 'react'
import './toDolist.css'
import ToDoListPage from './../../components/toDoList/ToDoListPage'
import Api from '../../axios/Axios'
const ToDoList = () => {



  const local = localStorage.getItem('token');
  const session = sessionStorage.getItem('token');
  const [user,setUser] = useState([])
  let token = ''

  if(!session){
      if(!local){
          window.location.href = '/login'
      } else{
        token = local
          sessionStorage.setItem('token',local)
      }
  } else{
    token = session




  }

  useEffect(()=>{
    getOptions()
    async function getOptions(){
      const config = {
        headers: { Authorization: `Bearer ${token}` }
    };
      await Api.get('/user/useroptions', config).then((data)=>{
        if(!data.data[0]){
          window.location.href = '/createuseroptions'
        } else{
          setUser(data.data[0])

        }
      })
    }
  },[])


  /*


  */

  return (



    <>  
        <div className='todolist-page'>

          <ToDoListPage user={user.id}/>
        </div>
    </>  )
}

export default ToDoList
